import AllMeetupsPage from './pages/AllMeetups';
import NewMeetUpsPage from './pages/NewMeetup';
import FavoritesPage from './pages/Favorites';


function App() {
  //our domain is localhost:3000/home
  return <div>
    <Route path='/'>
      <AllMeetupsPage/>
    </Route>
    <Route path='/new-'>
      <AllMeetupsPage/>
    </Route>

  </div>;
}

export default App;
